vanillajs_off_canvas={name:"vanillajs off canvas",version:"5.2.2x1",init:function(){this.events()},events:function(){var e=this;left_toggles=document.getElementsByClassName("left-off-canvas-toggle");if(left_toggles.length>0){left_toggles[0].onclick=function(t){obj=e.closest_wrap(t);e.click_toggle_class(obj,"move-right")}}right_toggles=document.getElementsByClassName("right-off-canvas-toggle");if(right_toggles.length>0){right_toggles[0].onclick=function(t){obj=e.closest_wrap(t);e.click_toggle_class(obj,"move-left")}}exit_elements=document.getElementsByClassName("exit-off-canvas");if(exit_elements.length>0){exit_elements[0].onclick=function(t){obj=e.closest_wrap(t);e.click_remove_class(obj,"move-right");e.click_remove_class(obj,"move-left")}}},click_toggle_class:function(e,t){if(e!=null)e.classList.toggle(t)},click_remove_class:function(e,t){if(e!=null)e.classList.remove(t)},closest_wrap:function(e){e=e.target;class_name="off-canvas-wrap";while(e=e.parentNode){if(e.classList.contains(class_name)){return e}}return null}}
